'Marketing maven Julia Ann has an important new client to impress, and she enlists her advertising team to come up with the perfect ad campaign. But Rocco Reed is too distracted by his lust for Brazilian hottie Jynx Maze to do any work, while Jynx's boyfriend Michael Vegas is consoled by scheming beauty CeCe Stone. Meanwhile, boss lady Julia Ann decides to make Toni Ribas her personal boy toy, until the Spanish hunk devises a plan to lie his way to the top. Will Melissa Monet derail his plan? Or is she too busy pleasing young lover Anthony Rosano?'
